    const [stateObjects, setStateObjects] = useState<VuiStateObject[]>([]);
    const [stateValues, setStateValues] = useState<VuiStateValue[]>([]);

    function replaceElementInArray<
        T extends {
            id: string;
        },
    >(elements: T[], data: T) {
        const result: T[] = [];
        elements.forEach((element) => {
            if (element.id === data.id) {
                result.push(data);
            }
            result.push(element);
        });
        return result;
    }

